import React, { Component } from 'react';

class Register extends Component {

    render() {
        return (
            <div class="wrapper fadeInDown">
                <div id="formContent">
                    
                    <h2 class="inactive underlineHover"> Sign In </h2>
                    <h2 class="active">Sign Up </h2>

                    
                    <form>
                    <input type="text" id="login" class="fadeIn second" name="username" placeholder="username" />
                    <input type="text" id="password" class="fadeIn third" name="password" placeholder="password" />
                    <input type="text" id="login" class="fadeIn second" name="email" placeholder="email" />
                    <input type="text" id="password" class="fadeIn third" name="firstname" placeholder="firstname" />
                    <input type="text" id="password" class="fadeIn third" name="lastname" placeholder="lastname" />
                    <input type="submit" class="fadeIn fourth" value="Register" />
                    </form>

                    
                    <div id="formFooter">
                    <a class="underlineHover" href="#">Login?</a>
                    </div>

                </div>
            </div>
        )
    }
}
export default Register;
